import React from "react";
import "./Notfound.css";

const Notfound = () => {
  return (
    <div className="not-found">
      <h3 className="title">Page Not Found</h3>
      <img
        src="https://cdn.pixabay.com/photo/2016/04/24/13/24/error-1349562_960_720.png"
        alt=""
      />
    </div>
  );
};

export default Notfound;
